import { useEffect, useState } from "react";
import { ref, onValue } from "firebase/database";
import { database } from "../../config/Firebase/firebase";
import { motion } from "framer-motion"; // Import motion dari framer-motion

const Testimonial = () => {
  const [Testimoni, setTestimoni] = useState({});
  const [namaTesti, setnamaTesti] = useState({});
  const [testimonialImage, setTestimonialImage] = useState({});

  useEffect(() => {
    const TestimoniRef = ref(database, "Testimoni/");
    onValue(TestimoniRef, (snapshot) => {
      const data = snapshot.val();
      setTestimoni(data);
    });
    const namaTestiRef = ref(database, "namaTesti/");
    onValue(namaTestiRef, (snapshot) => {
      const data = snapshot.val();
      setnamaTesti(data);
    });

    const testimonialImageRef = ref(database, "testimonialImage/");
    onValue(testimonialImageRef, (snapshot) => {
      const data = snapshot.val();
      setTestimonialImage(data);
    });
  }, []);

  return (
    <div className="container-xxl py-5">
      <div className="container">
        <div className="text-center mx-auto mb-5" style={{ maxWidth: 600 }}>
          <p className="d-inline-block border rounded-pill py-1 px-4">
            Testimonial
          </p>
          <h1>
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 1 }}
            >
              What Say Our Patients!
            </motion.div>
          </h1>
        </div>

        <div className="owl-carousel testimonial-carousel">
          {/* Testimonial 1 */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.2, duration: 1 }}
            className="testimonial-item text-center"
          >
            <img
              className="img-fluid bg-light rounded-circle p-2 mx-auto mb-4"
              src={`data:image/jpeg;base64, ${Testimoni.img1}`}
              style={{ width: 100, height: 100 }}
            />
            <div className="testimonial-text rounded text-center p-4">
              <p>{Testimoni.user1}</p>
              <h5 className="mb-1">{namaTesti.person1}</h5>
              <span className="fst-italic">Accountant</span>
            </div>
          </motion.div>

          {/* Testimonial 2 */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.4, duration: 1 }}
            className="testimonial-item text-center"
          >
            <img
              className="img-fluid bg-light rounded-circle p-2 mx-auto mb-4"
              src={`data:image/jpeg;base64, ${Testimoni.img2}`}
              style={{ width: 100, height: 100 }}
            />
            <div className="testimonial-text rounded text-center p-4">
              <p>{Testimoni.user2}</p>
              <h5 className="mb-1">{namaTesti.person2}</h5>
              <span className="fst-italic">Videographer</span>
            </div>
          </motion.div>

          {/* Testimonial 3 */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.6, duration: 1 }}
            className="testimonial-item text-center"
          >
            <img
              className="img-fluid bg-light rounded-circle p-2 mx-auto mb-4"
              src={`data:image/jpeg;base64, ${Testimoni.img3}`}
              style={{ width: 100, height: 100 }}
            />
            <div className="testimonial-text rounded text-center p-4">
              <p>{Testimoni.user3}</p>
              <h5 className="mb-1">{namaTesti.person3}</h5>
              <span className="fst-italic">Technician</span>
            </div>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default Testimonial;
